arif, Casablanca.', NULL, 0, '0', NULL, 0, '0', '0', '0', '4119.318181818182', NULL, '0', NULL, 0, 0, 'Casablanca', 'Racine', '2024-05-15', 47, NULL, 'Inconnu', '430867', NULL),
