bres, 2 salles de bains dont une suite parentale. Vous serez séduit par ses balcons qui offrent une vue dégagée sur les environs. Les frais de syndic mensuels s\'élèvent à 350 DHS. Ce bien est parfait pour les familles, les couples ou les investisseurs à la recherche d\'un projet neuf. Ne manquez pas cette opportunité unique et contactez-nous dès maintenant pour organiser une visite.', NULL, 0, '0', NULL, 0, '0', '0', '0', '18650.60240963856', NULL, '0', NULL, 0, 0, 'Casablanca', 'Hopitaux', '2024-05-15', 52, NULL, 'Inconnu', '835735', NULL),
