ité et contactez-nous dès maintenant pour organiser une visite!', NULL, 0, '0', NULL, 0, '0', '0', '0', '13008.13008130081', NULL, '0', NULL, 0, 0, 'Tanger', NULL, '2024-05-15', 62, NULL, 'Inconnu', '991438', NULL),
