 séjours - 2 chambres- 1 cuisine avec salle à manger- 1 salle de bain L\'état refait à neuf de la propriété en font un bien de grande qualité. Les deux façades sud ouest et nord est offrent une luminosité exceptionnelle à toutes les pièces. L\'orientation est parfaite pour profiter du soleil tout au long de la journée. L\'appartement est situé au 1er étage sur un immeuble de 4 étages, dans un quartier paisible. Le bien ne dispose pas de balcon, de terrasse, ni de cave, mais il offre un excellent potentiel. De plus, il n\'y a pas de parking inclus, mais des places de parking sont disponibles dans les environs. Le prix de vente est de 1 000 000 MAD avec des frais de syndic mensuels de 50 MAD. Pour plus d\'informations ou pour organiser une visite, veuillez nous contacter.Une opportunité à ne pas manquer!', NULL, 0, '0', NULL, 0, '0', '0', '0', '7421.875', NULL, '0', NULL, 0, 0, 'Mohammédia', NULL, '2024-05-15', 79, NULL, 'Inconnu', '902055', NULL),
