de syndic s\'élève à 400dhs/moisC\'est bien plus qu\'une simple propriété !C\'est une invitation à vivre dans l\'harmonie du confort moderne, au sein d\'un quartier résidentiel recherché.N\'attendez plus pour saisir cette opportunité unique et offrez-vous le privilège de résider dans ce véritable bijou au cœur de la Ferme Bretonne.', NULL, 0, '0', NULL, 0, '0', '0', '0', '18181.81818181818', NULL, '0', NULL, 0, 0, 'Casablanca', 'Ferme Bretonne', '2024-05-15', 133, NULL, 'Inconnu', '460731', NULL),
