mmobilier de qualité à Marrakech. Intéressé par un cadre de vie original et plein de charme? Ne laissez pas passer cette occasion unique !', NULL, 0, '0', NULL, 0, '0', '0', '0', '10000', NULL, '0', NULL, 0, 0, 'Marrakech', 'Daoudiat', '2024-05-15', 138, NULL, 'Inconnu', '671736', NULL),
