proximité.\r-	Écoles\r-	Supermarchés/hypermarchés\r-	Pharmacies\r-	Cliniques\r-	Salles de sport\r Les Allées de Californie 2, plus qu’une simple résidence, un cadre de vie créé exclusivement pour vous !', NULL, 0, '0', NULL, 0, '0', '0', '0', '14920.40816326531', NULL, '0', NULL, 0, 0, 'Casablanca', 'Mandarouna', '2024-05-15', 302, NULL, 'Inconnu', '95266817', NULL),
