fique appartement dès aujourd\'hui !', NULL, 0, '0', NULL, 0, '0', '0', '0', '18500', NULL, '0', NULL, 0, 0, 'Casablanca', 'Ferme Bretonne', '2024-05-15', 315, NULL, 'Inconnu', '418783', NULL),
